import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六庚日戊寅时断</p><p>六庚日生时戊寅，火生金绝福高人；月通从革或秋降，却做皇家柱石臣。</p><p>庚日戊寅时，火生金绝。</p><p>庚以丙为鬼，戊为倒食。</p><p>寅上有明戊、合癸化火，庚金气绝。</p><p>若不通金旺月，无救助者，夭贱贫下。</p><p>巳月，庚长生，丙健旺，身鬼俱强；运行西方，勇暴，武贵。</p><p>申酉丑戌月，金火合局，化鬼为官，更得身强运，贵。</p><p>庚子日戊寅时，寅午年月，登科显达。</p><p>纯申，三、四品贵。</p><p>丑月、金火运，公卿。</p><p>庚寅日戊寅时，月通火局或秋生，行身旺运，贵。</p><p>庚子月，自死。</p><p>年见辛酉，贫夭残疾。</p><p>身衰见丙太旺，同论。</p><p>庚辰日戊寅时，春夏生，干透丙丁，运行身旺，贵。</p><p>庚午日戊寅时，寅午戌月，金衰火旺，当带残疾。</p><p>纯寅，反主极贵。</p><p>秋，金旺，多贵，但忌时遇亡劫，克身则凶。</p><p>庚申日戊寅时，时日并冲，忧伤妻子。</p><p>寅卯辰月、火金运。</p><p>侯伯。</p><p>春月、西南运，大贵。</p><p>寅月，贵显不久。</p><p>一云先刑后吉。</p><p>庚戌日戊寅时，贵。</p><p>戌月，杂气财官印绶，贵。</p><p>庚辰年，己卯月者，侯伯。</p><p>庚日寅时甚可夸，无刑克破显忧华；运来自有高人助，时至如添锦上华。</p><p>庚日戊寅时秀，编印倒食难收。</p><p>少年未遇莫心忧，此命或贫或富。</p><p>时至发财发福，运来顺水行舟。</p><p>月中金水更相投，无破功名成就。</p>",33),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","241卷 九·六庚日戊寅时断.html.vue"]]);export{f as default};
